sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	if (inputs.status_code == '200') {
		outputs.status = 'Success';
		outputs.contact_details = inputs.response;
	} else {
		outputs.status = 'Error';
		outputs = new MicrosoftDynamicsCRMErrorHandler()
			.getContactDetailsErrorHandler(inputs, outputs);
	}
})(inputs, outputs);

